import { useState } from "react";

function Home() {
    const [cnt, setCnt] = useState(0);
    return (
        <div>
            Home
            <button onClick={()=>{
                setTimeout(()=> {
                    setCnt((a)=>a+1);
                    // console.log(cnt)
                }, Math.random()*2000);
            }}
            >{cnt}</button>
        </div>
    )
}

export default Home;
